import './assets/header.css'


function Header() {
    return (
        <>
        <header>
            <nav className='display-nav'>
                <ul>
                    <li><a href='#summary'>Ma présentation</a></li>
                    <li><a href='#projects'>Mes projets réalisés</a></li>
                    <li>Me contacter</li>
                </ul>
            </nav>
        </header>
        </>
    );
  }
  
  export default Header;
